import React, { useState, useEffect, useRef } from "react";
import API_BASE_URL from "../config";

const EquipmentList = ({ onSelect, onClose, selectedEquipment }) => {
    // Убедимся, что selectedEquipment всегда массив
    const [equipment, setEquipment] = useState([]);
    const [loading, setLoading] = useState(true);
    const [selectedItems, setSelectedItems] = useState(Array.isArray(selectedEquipment) ? selectedEquipment : []);
    const [searchTerm, setSearchTerm] = useState("");
    const listRef = useRef(null);

    // Обновляем selectedItems при изменении selectedEquipment
    useEffect(() => {
        setSelectedItems(Array.isArray(selectedEquipment) ? selectedEquipment : []);
    }, [selectedEquipment]);

    useEffect(() => {
        fetch(`${API_BASE_URL}/inventory`)
            .then((res) => {
                if (!res.ok) {
                    throw new Error(`HTTP error! status: ${res.status}`);
                }
                return res.json();
            })
            .then((data) => {
                setEquipment(Array.isArray(data) ? data : []);
                setLoading(false);
            })
            .catch((error) => {
                console.error("Ошибка загрузки оборудования:", error);
                setLoading(false);
            });

        const handleClickOutside = (event) => {
            if (listRef.current && !listRef.current.contains(event.target)) {
                onClose();
            }
        };

        document.addEventListener("mousedown", handleClickOutside);
        return () => {
            document.removeEventListener("mousedown", handleClickOutside);
        };
    }, [onClose]);

    const toggleSelection = (item) => {
        setSelectedItems((prevSelected) => {
            if (!Array.isArray(prevSelected)) prevSelected = [];
            const existingItem = prevSelected.find((selected) => selected.id === item.id);
            if (existingItem) {
                return prevSelected.filter((selected) => selected.id !== item.id);
            } else {
                const quantity = Math.min(1, item.available);
                return [...prevSelected, { ...item, quantity }];
            }
        });
    };

    const updateQuantity = (itemId, newQuantity, maxAvailable) => {
        if (!Array.isArray(selectedItems)) return;
        const quantity = Math.min(Math.max(1, newQuantity), maxAvailable);
        setSelectedItems(selectedItems.map((item) =>
            item.id === itemId ? { ...item, quantity } : item
        ));
    };

    const handleConfirm = () => {
        onSelect(Array.isArray(selectedItems) ? selectedItems : []);
        onClose();
    };

    const filteredEquipment = equipment.filter((item) =>
        item.name.toLowerCase().includes(searchTerm.toLowerCase())
    );

    // Остальной код компонента остается тем же...
    // (JSX часть остается без изменений)

    return (
        <div className="modal" ref={listRef}>
            <div className="modal-content">
                <h3>Выберите оборудование</h3>
                <input
                    type="text"
                    placeholder="Поиск..."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                    style={{ width: "100%", marginBottom: "10px", padding: "8px" }}
                />
                {loading ? (
                    <p>Загрузка...</p>
                ) : (
                    <ul style={{ 
                        maxHeight: "300px", 
                        overflowY: "auto",
                        listStyle: "none",
                        padding: 0
                    }}>
                        {filteredEquipment.map((item) => {
                            const selectedItem = Array.isArray(selectedItems) ? 
                                selectedItems.find(selected => selected.id === item.id) : null;
                            const isAvailable = item.available > 0;

                            return (
                                <li key={item.id} style={{
                                    padding: "8px",
                                    borderBottom: "1px solid #eee",
                                    display: "flex",
                                    alignItems: "center",
                                    justifyContent: "space-between"
                                }}>
                                    {/* Остальной код li остается без изменений */}
                                    {/* ... */}
                                </li>
                            );
                        })}
                    </ul>
                )}
                <div style={{ 
                    marginTop: "16px",
                    display: "flex",
                    justifyContent: "flex-end",
                    gap: "8px"
                }}>
                    <button onClick={onClose}>Отмена</button>
                    <button onClick={handleConfirm}>Готово</button>
                </div>
            </div>
        </div>
    );
};

export default EquipmentList;
